import React, { Component } from "react";
import ListItem from "./ListItem.js";

class List extends Component {
  constructor() {
    super();
    this.state = {
      loading: false,
      users: []
    };
  }

  render() {
    return (
      <table id="list">
        <thead>
          <tr className="head-row">
            <th>First name</th>
            <th>Last name</th>
          </tr>
        </thead>
        <tbody>
          <ListItem user={this.props.user} />
        </tbody>
      </table>
    );
  }
}

export default List;
